***Fork-join is a form of scheduling that divides the problem into subproblems of equal sizes, and runs the subproblems simultaneously on different CPUs. It is an efficient way to exploit parallel processing and to minimize CPU idle time. Parallelism in computing occurs due to the large discrepancy among processing times or communication costs of different operations.
Fork-join allows many computations to be started at once. When a result of one of these computations is available, it is compared with the result of another computation. If the two results match, all other computations are aborted and the one that produced the match is deemed the winner. Otherwise, all other computations may continue. For the case in which no result is available, the results of the computations that were running when the first result was available are compared. One (the winner) may be aborted and the others are deemed the runner up. If they all match and none of the former is the winner, all are winners and execution continues from the next step in execution. If none of the latter matches, aborted computations may not be restarted. This process is called a fork-join step, if it results in winning and runner-up steps, if not. [Fork-Join, Wikipedia](https://en.wikipedia.org/wiki/Fork-Join)
